import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const Todos = () => {
  const [formData, setFormData] = useState({
    id: '',
    open: '',
    high: '',
    low: '',
    volume: ''
  });

  const [prediction, setPrediction] = useState(null);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setPrediction(null);
    setError(null);

    try {
      const response = await fetch("http://localhost:5000/predict", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(formData)
      });

      const data = await response.json();
      if (response.ok && data.prediction !== undefined) {
        setPrediction(data.prediction);
      } else if (data.error) {
        setError(data.error);
      } else {
        setError("Unknown error occurred.");
      }
    } catch (error) {
      setError("Error connecting to backend.");
    }

    setLoading(false);
  };

  return (
    <div
      className="d-flex align-items-center justify-content-center"
      style={{
        minHeight: '100vh',
        background: 'linear-gradient(135deg, #232526 0%, #414345 100%)'
      }}
    >
      <div className="card shadow-lg border-0" style={{ borderRadius: '1.5rem', maxWidth: '400px', width: '100%' }}>
        <div className="card-body p-4">
          <div className="text-center mb-4">
            <img
              src="https://cryptologos.cc/logos/bitcoin-btc-logo.png"
              alt="Bitcoin"
              style={{ width: '80px', marginBottom: '1rem' }}
            />
            <h2 className="fw-bold" style={{ color: '#f7931a' }}>Bitcoin Predictor</h2>
            <p className="text-muted mb-0">
              Enter Bitcoin market values to predict the next price using AI.
            </p>
          </div>
          <form onSubmit={handleSubmit}>
            <div className="mb-3">
              <label className="form-label fw-bold">ID</label>
              <input
                type="number"
                className="form-control"
                name="id"
                value={formData.id}
                onChange={handleChange}
                placeholder="Enter ID"
                required
              />
            </div>
            <div className="mb-3">
              <label className="form-label fw-bold">Open</label>
              <input
                type="number"
                className="form-control"
                name="open"
                value={formData.open}
                onChange={handleChange}
                placeholder="Enter open price"
                required
              />
            </div>
            <div className="mb-3">
              <label className="form-label fw-bold">High</label>
              <input
                type="number"
                className="form-control"
                name="high"
                value={formData.high}
                onChange={handleChange}
                placeholder="Enter high price"
                required
              />
            </div>
            <div className="mb-3">
              <label className="form-label fw-bold">Low</label>
              <input
                type="number"
                className="form-control"
                name="low"
                value={formData.low}
                onChange={handleChange}
                placeholder="Enter low price"
                required
              />
            </div>
            <div className="mb-3">
              <label className="form-label fw-bold">Volume</label>
              <input
                type="number"
                className="form-control"
                name="volume"
                value={formData.volume}
                onChange={handleChange}
                placeholder="Enter volume"
                required
              />
            </div>
            <button
              type="submit"
              className="btn btn-warning w-100 fw-bold"
              style={{ fontSize: '1.1rem', letterSpacing: '1px' }}
              disabled={loading}
            >
              {loading ? "Predicting..." : "Predict"}
            </button>
          </form>
          {prediction !== null && (
            <div className="alert alert-success mt-4 text-center" style={{ fontSize: '1.2rem', fontWeight: 'bold' }}>
              <span role="img" aria-label="rocket">ðŸš€</span> Prediction: {prediction}
            </div>
          )}
          {error && (
            <div className="alert alert-danger mt-4 text-center">
              <strong>Error:</strong> {error}
            </div>
          )}
        </div>
        <div className="card-footer text-center bg-transparent border-0 pb-3">
          <small style={{ color: '#888' }}>Powered by AI &mdash; Bitcoin Price Predictor &copy; 2025</small>
        </div>
      </div>
    </div>
  );
};

export default Todos;
